css:
.github-RecentCommits {
  max-height: 53px;
  overflow-x: hidden;
  overflow-y: auto;
  border-top: 1px solid #2e303c;
}
.github-RecentCommits-list {
  margin: 0;
  padding: 0.5rem 0;
  list-style: none;
}
.github-RecentCommits-message {
  padding: 0.5rem 1rem;
  text-align: center;
  color: #acafbe;
}
.github-RecentCommit {
  position: relative;
  display: flex;
  align-items: center;
  padding: 0 1rem;
  line-height: 17px;
}
.github-RecentCommit-authors {
  position: absolute;
  display: flex;
}
.github-RecentCommit-avatar {
  position: relative;
  margin-right: -13px;
  width: 16px;
  height: 16px;
  border-radius: 4px;
  color: transparent;
  background-color: #515564;
  box-shadow: 1px 0 #3b3e4d;
  overflow: hidden;
  transition: margin 0.12s cubic-bezier(0.5, 0.1, 0, 1);
}
.github-RecentCommit-avatar:nth-child(1) {
  z-index: 3;
}
.github-RecentCommit-avatar:nth-child(2) {
  z-index: 2;
  opacity: .7;
}
.github-RecentCommit-avatar:nth-child(3) {
  z-index: 1;
  opacity: .4;
}
.github-RecentCommit-avatar:nth-child(n+4) {
  display: none;
}
.github-RecentCommit-avatar:only-child,
.github-RecentCommit-avatar:last-child {
  box-shadow: none;
}
.github-RecentCommit-authors:hover .github-RecentCommit-avatar {
  display: inline-block;
  margin-right: 1px;
  opacity: 1;
}
.github-RecentCommit-message {
  flex: 1;
  margin: 0 .5em;
  margin-left: 17px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
.github-RecentCommit-undoButton.btn {
  padding: 0 0.66666667rem;
  margin-right: 0.5rem;
  height: 20px;
  line-height: 1;
  font-size: .9em;
}
.github-RecentCommit-time {
  color: #acafbe;
}
.github-RecentCommit:hover {
  color: #d3d6e4;
  background: #292D3E;
}
.github-RecentCommit.is-selected {
  color: #f9f9fb;
  background: #3b3e4d;
}
.github-RecentCommits:focus .github-RecentCommit.is-selected {
  color: #ffffff;
  background: #484c5f;
}
@media (min-height: 900px) {
  .github-RecentCommits {
    max-height: 87px;
  }
}
@media (min-height: 1200px) {
  .github-RecentCommits {
    max-height: 172px;
  }
}
